import React from 'react';
import { Link } from "react-router-dom";
import Logo from '../../components/Logo';

export default function Topbar() {
  return (
    <header className="topbar">
      <nav className="topbar__menu">
        <div className='topbar__logo'>
          <Logo/>
        </div>
      </nav>
    </header>
  )
}
